import { ReactComponent as ProfileIcon } from 'assets/img/profile.svg';
import './styles.css'
//import 'bootstrap/dist/css/bootstrap.css';

function Navbar() {
    return (
        <header>
            <nav className="container">
                <div className="market-nav-content">
                    <h1>Marketplace</h1>
                    <a href="https://github.com/maquison/marketplace-kotlin-react">
                        <div className="market-contact-container">
                            <ProfileIcon />
                            <p className="market-contact-link">Perfil</p>
                        </div>
                    </a>
                    <div className="market-nav-content">
                        <span className="">oi</span>
                    </div>
                    <form className="dropdown-menu">
                        <input className="form-control ml-4 mr-2" type="search" placeholder="Buscar..." />
                        <button className="btn btn-default" type="submit">Ok</button>
                    </form>
                    
                </div>
            </nav>
        </header>
    );
}

export default Navbar;
